import React from "react";
import { useParams } from "react-router";

const params = useParams()
function EventDetailPage() {
  return (
    <>
      <h1>EventDetail Page</h1>
      <p>EVENT ID :{params.eventId} </p>
    </>
  );
}

export default EventDetailPage;
